"use strict";

function maximumProfit(present, future, budget) {
    let arr = present.map((a, i) => [a, future[i] - a]).filter(([a, b]) => b > 0);
    let dp = new Array(budget + 1).fill(0);
    for (let [v, w] of arr) {
        for (let j = budget; j >= v; j--) {
            dp[j] = Math.max(dp[j], dp[j - v] + w);
        }
    }
    return dp[budget];
}
